#include "Encoder.h"
#include "DCT.h"
#include "fDCT.h"
#include "ABAC.h"
#include "Profiler.h"
#include "Scan.h"



int main(int argc, char *argv[])
{
	YUVInput yuvInputParam;

	EncoderParam_Init();
	EncoderParam_InterpretInputParam(argc, argv);
	EncoderParam_CheckGlbParam();

	EncoderParam_PrintGlbParam();


	YUVInput_Init(&yuvInputParam);
	glbEncoderParam.yuvInputParam = &yuvInputParam;

	
	Encoder_EncodeSeq();


	//system("pause");
	return 0;
}

int Encoder_EncodeSeq()
{
	
	int		frameNoNow;

	//Open output coef file 
	if(glbEncoderParam.coefFileStr)
	{
		if(  (glbEncoderParam.coefFile = fopen(glbEncoderParam.coefFileStr, "wb")) == NULL )
		{
			printf("[error]Cannot open output coef file '%s' to write!\n", glbEncoderParam.coefFileStr);
			exit(-1);
		}
	}


	//print column title
	printf(" GOP |Frame Number |  Bits  |Bits AC|Time(ms)|Time DCT|TimeQ|TimeScan|TimeABAC|\n");

	for(frameNoNow = glbEncoderParam.codedFrameMin; frameNoNow <= glbEncoderParam.codedFrameMax; frameNoNow += 8)
	{
		Profiler_ResetTimer(TIMER_GOP);
		Profiler_StartTimer(TIMER_GOP);

		Encoder_EncodeOneGOP(frameNoNow);
	}

	//Close opened file
	if(glbEncoderParam.coefFile)
		fclose(glbEncoderParam.coefFile);	

	return 0;
}


int Encoder_EncodeOneGOP(int frameNoBegin)
{
	int		frameNoNow, xNow, yNow;
	int		numBlocksInOneGOP = glbEncoderParam.codedHeight * glbEncoderParam.codedWidth / (BLOCK_SIZE_X * BLOCK_SIZE_Y);
	int		blockID = 0;
	int32	*coefDC, coefBlock[BLOCK_SIZE_BYTE];
	uint8	dataBlock[BLOCK_SIZE_BYTE];
	size_t abacAcBitNum = 0;
	Abac_t cb;		// ABAC state
	uint8 uiScanMode ;
	uint8* BitStream = ( uint8* ) malloc( BITSTREAM_SIZE * sizeof(uint8) );

	
	Profiler_ResetTimer(TIMER_DCT3);
	Profiler_ResetTimer(TIMER_Q);
	Profiler_ResetTimer(TIMER_SCAN);
	Profiler_ResetTimer(TIMER_ABAC);

	Profiler_StartTimer(TIMER_ABAC);
	Abac_encode_init(&cb, BitStream);
	Profiler_PauseTimer(TIMER_ABAC);

	coefDC = malloc(numBlocksInOneGOP * sizeof(int64));
	
	for(yNow = 0; yNow < glbEncoderParam.codedHeight; yNow += BLOCK_SIZE_Y)
	{
		for(xNow = 0; xNow < glbEncoderParam.codedWidth; xNow += BLOCK_SIZE_X)
		{
			//Read YUV data
			for(frameNoNow = frameNoBegin; frameNoNow < frameNoBegin + 8; ++frameNoNow)
			{
				uint8 *frameData = YUVInput_GetFrameData(frameNoNow);
				uint8 *p = frameData + yNow*glbEncoderParam.codedWidth + xNow;
				uint8 *q = dataBlock + (frameNoNow - frameNoBegin)*BLOCK_SIZE_X * BLOCK_SIZE_Y;

				for(	;
						q < dataBlock + (frameNoNow - frameNoBegin+1) * BLOCK_SIZE_X * BLOCK_SIZE_Y;
						p += glbEncoderParam.codedWidth, q += BLOCK_SIZE_X)
				{
					memcpy(q, p, BLOCK_SIZE_X);
				}
			}

			//DCT, Q & Scanning
			Encoder_EncodeOneBlock(dataBlock, coefBlock);

			//**************************** Write coef file ****************************
			if(glbEncoderParam.coefFile)
			{
				int		coefP = 0, i;
				int  coefFileOffsetFrame = 0, coefFileOffset = 0;

				coefFileOffsetFrame = (frameNoBegin * glbEncoderParam.codedHeight * glbEncoderParam.codedWidth) + (yNow * glbEncoderParam.codedWidth) + xNow ;
			
				for(i=0; i<BLOCK_SIZE_Z; ++i, coefFileOffsetFrame += glbEncoderParam.codedWidth * glbEncoderParam.codedHeight)
				{
				//		printf("%d\n",coefFileOffsetFrame);
					for(coefFileOffset = coefFileOffsetFrame; coefP < BLOCK_SIZE_X * BLOCK_SIZE_Y * (i+1)
									; coefFileOffset += glbEncoderParam.codedWidth, coefP += BLOCK_SIZE_X)
					{
						size_t	fwriteRetVal;
						if( fseek(glbEncoderParam.coefFile, coefFileOffset * sizeof(int32), SEEK_SET) )
						{
							printf("[error]Fseek error for coefFile '%s', offset=%d(SEEK_SET)\n", glbEncoderParam.coefFileStr, coefFileOffset);
							exit(-1);
						}

						fwriteRetVal = fwrite(&coefBlock[coefP], 1, sizeof(int32) * BLOCK_SIZE_X, glbEncoderParam.coefFile);
						if( fwriteRetVal != BLOCK_SIZE_X * sizeof(int32) ) 
						{
							printf("[error]Fwrite error! Request %d bytes, but only write %ld bytes\n"
													, BLOCK_SIZE_X * sizeof(int32), (int64)fwriteRetVal);
							exit(-1);
						}
					}
				}

			}
			//***************************************************************************

			coefDC[blockID] = coefBlock[0];		//save DC coef of each block
			//SCAN
			Profiler_StartTimer(TIMER_SCAN);
			uiScanMode = Scan_ModeDecision(coefBlock);
			Scan_Sort(coefBlock, uiScanMode);
			Profiler_PauseTimer(TIMER_SCAN);

			//Entropy Coding for AC Coefficients
			Profiler_StartTimer(TIMER_ABAC);

			Abac_ScanMode(&cb, uiScanMode);
			Abac_block_ac(&cb, coefBlock+1 );
			Abac_encode_terminal(&cb);		// end block

			Profiler_PauseTimer(TIMER_ABAC);


			++blockID;
		}
	}

	// Entropy Coding for DC Coefficients
	Profiler_StartTimer(TIMER_ABAC);

	abacAcBitNum = cb.p - cb.p_start;
	Abac_GOP_dc(&cb, coefDC);
	Abac_encode_flush(&cb);		// end GOP

	Profiler_PauseTimer(TIMER_ABAC);

	// Import to file

	//Output_XXX( BitStream );

	/*Print information for this GOP
	 *** GOP |Frame Number |  Bits  |Bits AC|Time(ms)|Time DCT|TimeQ|TimeScan|TimeABAC|
	 ***xxxxx|xxxxx - xxxxx|xxxxxxxx|1234567|12345678|12345678|12345|12345678|12345678|
	 *
	 */
	{
#define   MAX_PRINTBUFFER   256

		char	printBuf[MAX_PRINTBUFFER];
		uint32	bufLen = 0;

		memset(printBuf, 0x00, sizeof(printBuf));
		//GOP number
		bufLen += _snprintf(&printBuf[bufLen], (sizeof(printBuf) - bufLen), "%5d|", frameNoBegin / BLOCK_SIZE_Z);
		//Frame number
		bufLen += _snprintf(&printBuf[bufLen], (sizeof(printBuf) - bufLen), "%5d - %-5d|", frameNoBegin, frameNoBegin + 7);
		//# of bits
		bufLen += _snprintf(&printBuf[bufLen], (sizeof(printBuf) - bufLen), "%8d|", 8 * (cb.p - cb.p_start));
		//# of bits
		bufLen += _snprintf(&printBuf[bufLen], (sizeof(printBuf) - bufLen), "%7d|", 8 * abacAcBitNum);
		//Time
		Profiler_StopTimer(TIMER_GOP);
		bufLen += _snprintf(&printBuf[bufLen], (sizeof(printBuf) - bufLen), "%8.0lf|", Profiler_ReadTimerInSecond(TIMER_GOP) * 1000);
		Profiler_StopTimer(TIMER_DCT3);
		bufLen += _snprintf(&printBuf[bufLen], (sizeof(printBuf) - bufLen), "%8.0lf|", Profiler_ReadTimerInSecond(TIMER_DCT3) * 1000);
		Profiler_StopTimer(TIMER_Q);
		bufLen += _snprintf(&printBuf[bufLen], (sizeof(printBuf) - bufLen), "%5.0lf|", Profiler_ReadTimerInSecond(TIMER_Q) * 1000);
		Profiler_StopTimer(TIMER_SCAN);
		bufLen += _snprintf(&printBuf[bufLen], (sizeof(printBuf) - bufLen), "%8.0lf|", Profiler_ReadTimerInSecond(TIMER_SCAN) * 1000);
		Profiler_StopTimer(TIMER_ABAC);
		bufLen += _snprintf(&printBuf[bufLen], (sizeof(printBuf) - bufLen), "%8.0lf|", Profiler_ReadTimerInSecond(TIMER_ABAC) * 1000);
		
		//print
		if(bufLen >= sizeof(printBuf))
		{
			printf("output Buffer overrun\n");
			exit(-1);
		}
		printBuf[sizeof(printBuf) - 1] = 0x00;
		printf("%s\n", printBuf);
		fflush(stdout);

#undef	MAX_PRINTBUF
	}

	return 0;
}

